import { ActionType } from "../common/resources/redux/types";

interface ReducerState {
    getCategories: {},
    getBrand: {},
    getPrice: {},
    getColor: {},
}

export default function reducer(
    state: ReducerState = {
        getCategories: {},
        getBrand: {},
        getPrice: {},
        getColor: {},
    },
    action: ActionType
): ReducerState {
    switch (action.type) {
        case "PROJECT_LIST": {
            return { ...state, getProjectList: action.payload };
        }
        case "PROJECT_SELECTED": {
            return { ...state, projectid: action.payload };
        }
    }
    return state;
}
